import net.sf.json.groovy.*;


def res_FirstValueItem = context.expand( '${Get Characteristic Values of change entity char bi after 2 values saving#res_FirstValueItemFull}' )
def res_SecondValueItem = context.expand( '${Get Characteristic Values of change entity char bi after 2 values saving#res_SecondValueItemFull}' )
def jsonFirstValueItem = new JsonSlurper().parseText (res_FirstValueItem);
def jsonSecondValueItem = new JsonSlurper().parseText (res_SecondValueItem);

def res_characteristicIdForFirstItem = context.expand( '${Get Characteristic Values of change entity char bi after 2 values saving#res_characteristicId}' ).toString();
def res_characteristicIdForSecondItem = context.expand( '${Get Characteristic Values of change entity char bi after 2 values saving#res_characteristicIdForSecondItem}' ).toString();

def res_CharIdForList = context.expand( '${Create characteristic for list type#res_CharId}' ).toString();
def res_CharIdForInt = context.expand( '${Create characteristic for int type#res_CharId}' ).toString();

//default
testRunner.testCase.testSteps['Properties for 2 values control keys'].setPropertyValue("FirstItemControlIsValid","false");
testRunner.testCase.testSteps['Properties for 2 values control keys'].setPropertyValue("SecondItemControlIsValid","false");

//If first item is list type
if(res_characteristicIdForFirstItem == res_CharIdForList)
{
	//First Item Control (list)
	def characteristicValue1 = jsonFirstValueItem['characteristicValue'].value.toString();
	def req_characteristicValueForList = context.expand( '${Save Characteristic Values for change entity char BI with list and int values#req_characteristicValueForList}' ).toString();
	if(characteristicValue1.equals(req_characteristicValueForList))
	testRunner.testCase.testSteps['Properties for 2 values control keys'].setPropertyValue("FirstItemControlIsValid","true")

	//Second Item Control (int)
	def characteristicValue2 = jsonSecondValueItem['value'].toString();
     def req_characteristicValueForInt = context.expand( '${Save Characteristic Values for change entity char BI with list and int values#req_characteristicValueForInt}' ).toString();
	if(characteristicValue2.equals(req_characteristicValueForInt))
	testRunner.testCase.testSteps['Properties for 2 values control keys'].setPropertyValue("SecondItemControlIsValid","true")
}
//Else If first item is int type
else if(res_characteristicIdForFirstItem == res_CharIdForInt)
{
     //First Item Control (int)
	def characteristicValue1 = jsonFirstValueItem['value'].toString();
     def req_characteristicValueForInt = context.expand( '${Save Characteristic Values for change entity char BI with list and int values#req_characteristicValueForInt}' ).toString();
	if(characteristicValue1.equals(req_characteristicValueForInt))
	testRunner.testCase.testSteps['Properties for 2 values control keys'].setPropertyValue("FirstItemControlIsValid","true")
	
	//Second Item Control (list)
	def characteristicValue2 = jsonSecondValueItem['characteristicValue'].value.toString();
	def req_characteristicValueForList = context.expand( '${Save Characteristic Values for change entity char BI with list and int values#req_characteristicValueForList}' ).toString();
	if(characteristicValue2.equals(req_characteristicValueForList))
	testRunner.testCase.testSteps['Properties for 2 values control keys'].setPropertyValue("SecondItemControlIsValid","true")
}

